(2591, 258, '_subheading_5', 'field_64786a61649c2'),
(2592, 258, 'content_5', '<p class=\"wow slideInUp\">Vielen privaten Interessenten fehlt die Vorstellungskraft, wie eine leere Wohnung später aussehen könnte. Das führt nicht selten dazu, dass seriöse Interessenten ausbleiben, oder potenzielle Käufer stärker mit den Preisen handeln.</p>\r\n<p class=\"wow slideInUp\">Erhöhen Sie jetzt mit ELANA Ihre Chancen auf einen schnellen Verkauf!</p>'),
