(2606, 258, 'testimonial_0_descriptions_tm', '<div>\r\n<div>Das Team von Elena hat wirklich eine tolle Arbeit gemacht.</div>\r\n<div>Überzeugt haben mich die schnelle Umsetzung aber auch die sympathische Art</div>\r\n<div>des</div>\r\n<div>Teams.</div>\r\n<div>Das Ergebnis lässt sich wirklich sehen, die Wohnung war kaum</div>\r\n<div>wiederzu-erkennen.</div>\r\n<div>Leerstehend war die Wohnung zwar schön aber kühl und nicht besonders</div>\r\n<div>einladend.</div>\r\n<div>Alles in allem herausragende Arbeit und wirklich zu empfehlen!</div>\r\n</div>'),
