e\"><img src=\"http://localhost/staggingweb/wp-content/uploads/2023/06/slider2.jpg\" alt=\"slider\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/uploads/2023/06/slider1.jpg\" alt=\"slider\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/uploads/2023/06/slider5.jpg\" alt=\"slider\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/uploads/2023/06/slider4.jpg\" alt=\"slider\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Entfachen Sie Begeisterung und stoppen Sie den&nbsp;<strong>Preisverfall</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Kaufinteressenten, die den Wert Ihrer Immobilie nicht einzuschätzen vermögen, geben keine Preisangebote ab, oder verhandeln ungebührlich über den Verkaufs- preis. Mit Home Staging by ELANA helfen wir Ihrem zukünftigen Käufer das wahre Potenzial Ihrer Immobilie zu erkennen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://localhost/staggingweb/#\"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Etagenwohnung Frankfurt</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Staging im Kinderzimmer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/logo-gr.svg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>‹›</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\"><strong>3900€</strong>&nbsp;Basispreis<sup>*</sup></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>*zzgl. MwSt.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Für Objekte zwischen 30 und 80m2 zahlen Sie nur 35€ pro weiteren Quadratmeter.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://localhost/staggingweb/#\">JETZT ANFRAGEN</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">Wie viel kostet Sie Home Staging für Ihr Objekt?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tragen Sie hier Ihre Wohnfläche ein:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;m<sup>2</sup></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/cta-arrow.svg\" alt=\"arrow\">3.900€</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Home Staging bekannt aus:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"http://localhost/staggingweb/#\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/client/ZDF_logo.png\" alt=\"ZDF\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"http://localhost/staggingweb/#\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/client/WDR_Dachmarke.png\" alt=\"WDR\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"http://localhost/staggingweb/#\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/client/Frankfurter_Allgemeine.png\" alt=\"Frankfurter Allgemeine\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image\"><a href=\"http://localhost/staggingweb/#\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/client/Logo-DER_SPIEGEL.png\" alt=\"DER SPIEGEL\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Nichts ist so wichtig wie der erste Eindruck.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>Vielleicht haben Sie es bemerkt:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Vielen privaten Interessenten fehlt die Vorstellungskraft, wie eine leere Wohnung später aussehen könnte. Das führt nicht selten dazu, dass seriöse Interessenten ausbleiben, oder potenzielle Käufer stärker mit den Preisen handeln.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Erhöhen Sie jetzt mit ELANA Ihre Chancen auf einen schnellen Verkauf!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://localhost/staggingweb/#\">ZU DEN LEISTUNGEN</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost/staggingweb/wp-content/themes/staggingweb/assets/img/welle-01.svg\" alt=\"\"/></figure>\n