(192, 1, '2023-06-02 06:22:51', '2023-06-02 06:22:51', '<!-- wp:paragraph -->\n<p>Dies ist ein Typoblindtext. An ihm kann man sehen, ob alle Buchstaben da sind und wie sie aussehen. Manchmal benutzt man Worte wie Hamburgefonts, Rafgenduks oder Handgloves, um Schriften zu testen. Manchmal Sätze, die alle Buchstaben des Alphabets enthalten – man nennt diese Sätze »Pangrams«. Sehr bekannt ist dieser: The quick brown fox jumps over the lazy old dog.</p>\n<!-- /wp:paragraph -->', 'Frankfurt-Rebstock', '', 'publish', 'closed', 'closed', '', 'frankfurt-rebstock', '', '', '2023-06-02 10:22:13', '2023-06-02 10:22:13', '', 0, 'http://localhost/staggingweb/?post_type=ourportfolio&#038;p=192', 0, 'ourportfolio', '', 0),
